interface RoomToggleProps {
    roomName: string
    isSignedIn: boolean
}
function RoomToggle({roomName, isSignedIn}: RoomToggleProps) {
  return (
      <div>
          {roomName}
          <p>{isSignedIn ? "Yes" : "No"}</p>
      </div>
  )
}

export default RoomToggle
